import { useState } from "react";
import api from "../api/globalApi";

function GenerateApp() {
  const [className, setClassName] = useState("");
  const [responseMsg, setResponseMsg] = useState("");

  const handleGenerate = async () => {
    try {
      const payload = {
        className,
        fields: [], // include fields if required
      };
      const response = await api.post("/generateApp", payload);
      setResponseMsg(response.data.message);
    } catch (err) {
      console.error("Error generating app:", err);
      setResponseMsg("Error generating app");
    }
  };

  return (
    <div>
      <h2>Generate Spring Boot App</h2>
      <input
        type="text"
        value={className}
        onChange={(e) => setClassName(e.target.value)}
        placeholder="Enter full class name"
      />
      <button onClick={handleGenerate}>Generate</button>
      {responseMsg && <p>{responseMsg}</p>}
    </div>
  );
}

export default GenerateApp;
